    display:flex;
    justify-content:space-between;
`;
const Left = styled.div`
    flex:1;
`;
const Center = styled.div`
    flex:1;
`;
const Right = styled.div`
    widthe:33.3%;
`;

const Navbar = () => {
  return (
   <Container>
    <Wrapper>
        <Left>left</Left>
